    this.state = {
      help: null
    };


  }


  componentDidMount(){
    this.setState({help:1})

  }



  render() {

const { lat, lng } = this.props;

const Box = posed.div();

    return (
<div className="p-4">

{lat}{"  "}{lng}

{this.state.help && (<OfferHelp />)}

<Box className="box" />;

</div>

    );
  } 
}

export default Helper;
